            onClick={() => setCurrentView('dashboard')}
          >
            Dashboard
          </button>
          <button 
            className={currentView === 'counseling' ? 'nav-btn active' : 'nav-btn'}
            onClick={() => setCurrentView('counseling')}
          >
            Book Counseling
          </button>
          <button 
            className={currentView === 'booking' ? 'nav-btn active' : 'nav-btn'}
            onClick={() => setCurrentView('booking')}
          >
            Session Booking
          </button>
        </nav>
      </header>

      {/* Main Content */}
      <main className="app-main">
        {currentView === 'dashboard' && <UserDashboard />}
        {currentView === 'counseling' && <Counseling />}
        {currentView === 'booking' && (
          <div className="booking-container">
            <SessionBooking />
          </div>
        )}
      </main>

      {/* Footer */}
      <footer className="app-footer">
        <p>Member 2 - Counseling System ðŸš€</p>
      </footer>
    </div>
  );
}

export default App;
